int GameonModelData_getDataLen(GameonModelData_Type type)
{
     switch (type) {
        case GMODEL_CUBE:
            return sizeof(modelCube)/sizeof(float)/3;
        case GMODEL_SPHERE:
            return sizeof(modelSphere)/sizeof(float)/3;
         case GMODEL_CYLYNDER:
             return sizeof(modelCyl)/sizeof(float)/3;
        default:
             return 0;
    }
    return 0;
    
}


modeldata* GameonModelData_getData(GameonModelData_Type type)
{
    switch (type) {
        case GMODEL_CUBE:
            return &modelCube;
        case GMODEL_CYLYNDER:
            return &modelCyl;
        case GMODEL_SPHERE:
            return &modelSphere;			
        default:
            return NULL;
    }
    return NULL;
}


